class Lantern
  
  def initialize
    @range = 3 # Rango de la linterna
    @light_spriteX = Sprite.new
    @light_spriteX.bitmap = Bitmap.new("Graphics/Pictures/linternaX") # Gráfico de la linterna
    @light_spriteX.z = 99999 # Asegúrate de que esté en un nivel superior
    @light_spriteY = Sprite.new
    @light_spriteY.bitmap = Bitmap.new("Graphics/Pictures/linternaY") # Gráfico de la linterna
    @light_spriteY.z = 99999 # Asegúrate de que esté en un nivel superior
  end

  def update
    return if !$game_map
    
    player_x = $game_player.x
    player_y = $game_player.y

      # Mover el sprite de la linterna delante del jugador según dirección
      case $game_player.direction
      when 2 # Abajo
        @light_spriteX.x = -99999
        @light_spriteX.y = -99999
        @light_spriteY.x = 247 # Ajusta la posición según el tamaño del tile
        @light_spriteY.y = 205 # Coloca el foco delante
      when 4 # Izquierda
        @light_spriteY.x = -99999
        @light_spriteY.y = -99999
        @light_spriteX.x = 180 # Coloca el foco delante
        @light_spriteX.y = 190
      when 6 # Derecha
        @light_spriteY.x = -99999
        @light_spriteY.y = -99999
        @light_spriteX.x = 270 # Coloca el foco delante
        @light_spriteX.y = 190
      when 8 # Arriba
        @light_spriteX.x = -99999
        @light_spriteX.y = -99999
        @light_spriteY.x = 247 # Ajusta la posición según el tamaño del tile
        @light_spriteY.y = 80 # Coloca el foco delante
      end 
      
      # Buscar eventos dentro del rango de la linterna
      $game_map.events.each_value do |event|
        next unless event.name == "oculto" # Solo afecta a eventos con el nombre "oculto"
        distance = Math.sqrt((event.x - player_x) ** 2 + (event.y - player_y) ** 2)
        if distance <= @range
          event.opacity = 255 # Mostrar el evento
          event.visible = true # Asegúrate de que el evento sea visible
        else
          event.opacity = 0 # Ocultar el evento si está fuera del rango
          event.visible = false # Asegúrate de que el evento no sea visible
        end
      end
  end

  def dispose
    @light_spriteX.dispose if @light_spriteX
    @light_spriteY.dispose if @light_spriteY
    $game_map.update
    RPG::Cache.clear
    Graphics.update
  end
end

